--
-- Table structure for table `bls`
--

DROP TABLE IF EXISTS `bls`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `bls` (
  `id` int NOT NULL AUTO_INCREMENT,
  `manifiesto_id` int NOT NULL,
  `bl_number` varchar(50) NOT NULL,
  `tipo_servicio_id` int DEFAULT NULL,
  `shipper` varchar(255) DEFAULT NULL,
  `consignee` varchar(255) DEFAULT NULL,
  `notify_party` varchar(255) DEFAULT NULL,
  `shipper_id` int DEFAULT NULL COMMENT 'FK a participantes.id - Shipper resuelto desde codigo PIL',
  `consignee_id` int DEFAULT NULL COMMENT 'FK a participantes.id - Consignee resuelto desde codigo PIL',
  `notify_id` int DEFAULT NULL COMMENT 'FK a participantes.id - Notify resuelto desde codigo PIL',
  `fecha_emision` date DEFAULT NULL,
  `fecha_presentacion` datetime DEFAULT NULL,
  `fecha_embarque` datetime DEFAULT NULL,
  `fecha_zarpe` datetime DEFAULT NULL,
  `descripcion_carga` text,
  `peso_bruto` decimal(12,3) DEFAULT NULL,
  `unidad_peso` varchar(3) DEFAULT NULL,
  `volumen` decimal(12,3) DEFAULT NULL,
  `unidad_volumen` varchar(3) DEFAULT NULL,
  `bultos` int DEFAULT NULL,
  `total_items` int DEFAULT NULL,
  `status` enum('CREADO','VALIDADO','ENVIADO','ANULADO') DEFAULT 'CREADO',
  `valid_status` enum('OK','OBS','ERROR') NOT NULL DEFAULT 'OK',
  `valid_count_error` int NOT NULL DEFAULT '0',
  `valid_count_obs` int NOT NULL DEFAULT '0',
  `valid_last_run` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `lugar_emision_id` int DEFAULT NULL,
  `puerto_embarque_id` int DEFAULT NULL,
  `puerto_descarga_id` int DEFAULT NULL,
  `lugar_destino_id` int DEFAULT NULL,
  `lugar_entrega_id` int DEFAULT NULL,
  `lugar_recepcion_id` int DEFAULT NULL,
  `lugar_emision_cod` varchar(20) DEFAULT NULL,
  `puerto_embarque_cod` varchar(20) DEFAULT NULL,
  `puerto_descarga_cod` varchar(20) DEFAULT NULL,
  `lugar_destino_cod` varchar(20) DEFAULT NULL,
  `lugar_entrega_cod` varchar(20) DEFAULT NULL,
  `lugar_recepcion_cod` varchar(20) DEFAULT NULL,
  `forma_pago_flete` enum('PREPAID','COLLECT') DEFAULT NULL COMMENT 'Forma de pago del flete (PREPAID/COLLECT)',
  `cond_transporte` varchar(10) DEFAULT NULL COMMENT 'Condicin de transporte (ej: HH, CY, etc.)',
  `observaciones` text COMMENT 'Observaciones generales del BL',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_bl_manifiesto` (`manifiesto_id`,`bl_number`),
  KEY `fk_bls_tipo_servicio` (`tipo_servicio_id`),
  KEY `fk_bls_le` (`lugar_emision_id`),
  KEY `fk_bls_pe` (`puerto_embarque_id`),
  KEY `fk_bls_pd` (`puerto_descarga_id`),
  KEY `fk_bls_ld` (`lugar_destino_id`),
  KEY `fk_bls_lem` (`lugar_entrega_id`),
  KEY `fk_bls_lrm` (`lugar_recepcion_id`),
  KEY `idx_bls_shipper_id` (`shipper_id`),
  KEY `idx_bls_consignee_id` (`consignee_id`),
  KEY `idx_bls_notify_id` (`notify_id`),
  CONSTRAINT `fk_bls_consignee` FOREIGN KEY (`consignee_id`) REFERENCES `participantes` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_bls_ld` FOREIGN KEY (`lugar_destino_id`) REFERENCES `puertos` (`id`),
  CONSTRAINT `fk_bls_le` FOREIGN KEY (`lugar_emision_id`) REFERENCES `puertos` (`id`),
  CONSTRAINT `fk_bls_lem` FOREIGN KEY (`lugar_entrega_id`) REFERENCES `puertos` (`id`),
  CONSTRAINT `fk_bls_lrm` FOREIGN KEY (`lugar_recepcion_id`) REFERENCES `puertos` (`id`),
  CONSTRAINT `fk_bls_manifiesto` FOREIGN KEY (`manifiesto_id`) REFERENCES `manifiestos` (`id`) ON DELETE CASCADE,
  CONSTRAINT `fk_bls_notify` FOREIGN KEY (`notify_id`) REFERENCES `participantes` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_bls_pd` FOREIGN KEY (`puerto_descarga_id`) REFERENCES `puertos` (`id`),
  CONSTRAINT `fk_bls_pe` FOREIGN KEY (`puerto_embarque_id`) REFERENCES `puertos` (`id`),
